import React from 'react'
import './css/ArticleView.css'
import { Link } from 'react-router-dom';
import {API_BASE_URL} from './config'



export default class LandingPageArticle extends React.Component {

    render() {
        // id= {this.props.article.id};
        if (!this.props.lpArticle){return <div></div>}   
        return(
            <section id="article">
                <div id="previewImageContainer"><img id="previewImage" src={this.props.lpArticle.image} /></div>
                <div id="articleText">
                    <h3 id="articleText">{this.props.lpArticle.headline}</h3>
                    <p id="articleText">{this.props.lpArticle.summary}</p>
                    <Link to={"/dashboard/article/"+this.props.lpArticle.id}><button>View Full Article</button></Link>
                </div>
            </section>
                );
}
}
